import React from "react";

const NotFound = () => {
   return (
      <div>
         <div class="jumbotron jumbotron-fluid">
            <div class="container">
               <h1 class="display-4">404 Not Found!</h1>
               <p class="lead">
                  This is a modified jumbotron that occupies the entire
                  horizontal space of its parent.
               </p>
            </div>
         </div>
      </div>
   );
};

export default NotFound;
